description:
Micro Monsters with David Attenborough is a wildlife series which sees Sir David Attenborough taking a look at the macroscopic world of bugs.

 David Attenborough shifts the focus to bugs that prefer cooperation rather than conflict. They include burrowing cockroaches, the suitably named social spiders - which share a 30-metre web - the queen bee and her happy hive of workers, and green ants pulling together to build a nest.

